    "2013-03-14T19:45:09.989747",nt"name": "city-limits-2004-east-baton-rouge-parish-louisiana",nt"isopen":
    false,nt"url": null,nt"notes": "This is a graphical polygon dataset depicting
    the polygon boundaries of the incorporated city limits of Baton Rouge, Baker, and
    Zachary within East Baton Rouge Parish, Louisiana. The incorporated city of Baton
    Rouge covers an area of approximately 74.4 square miles (2004) and has an approximate
    population of 230,000 (2000 Census). The incorporated city of Baker covers approximately
    7.9 square miles (2004) with a population of 13,793 (2000 Census). The incorporated
    city of Zachary covers an area of approximately 23.7 square miles (2004) with a
    population of 11,275 (2000 Census). The availability of public services and the
    application of a wide array of taxes will depend on whether or not a property is
    located within city limits. This dataset conveys the best currently (2004) available
    representation of the city limits of the cities of Baton Rouge, Baker and Zachary,
    Louisiana.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
